import React from "react";
import { Link } from "react-router-dom";

const DashboardActions = () => {

    return(

        <div class="dash-buttons">
        <Link to="/edit-profile" className=" button-edit"
          ><i className="fas fa-user-circle text-primary"></i> Edit Profile</Link>
        <Link to="/add-experience" className=" button-add"
          ><i className="fab fa-black-tie text-primary"></i> Add Experience</Link >
        <Link to="/add-education" className="btn button-education"
          ><i className="fas fa-graduation-cap text-primary"></i> Add Education</Link>
      </div>
    )
}

export default DashboardActions;
